<script>
  export default {
    name: 'story',
    data() {
      return {
        isMobile: false,
        mq: null
      };
    },
    created() {
      if (window.matchMedia) {
        this.mq = window.matchMedia('(min-width: 560px)');
        this.mq.addListener(this.checkIfMobile);
        this.checkIfMobile(this.mq);
      }
    },
    mounted() {
      const controller = new ScrollMagic.Controller();
      const container = this.$refs.story_board;
      const sceneWrapper = this.$refs.scene_wrapper;
      const sceneElem = this.$refs.scene_elem;
      // const moneyLine = this.$refs.money_line
      const moneyOne = this.$refs.initial_fund;
      const moneyTwo = this.$refs.withdrawn_fund;
      const mojaCard = this.$refs.moja_card;

      // this.pathPrepare(moneyLine)

      // Scene tween
      const translateScene = new TimelineLite({delay: this.isMobile ? .24 : .3})
        .add(TweenLite.to(sceneElem, 1, {transform: this.isMobile ? 'translateX(-3000px)' : 'translateX(-2600px)'}));

      new ScrollMagic.Scene({
        triggerElement: '#story-mode',
        triggerHook: 0.8,
        duration: 2800
      })
        .setTween(translateScene)
        // .addIndicators()
        .addTo(controller);

      // Background tween
      const bgTween = new TimelineLite()
        .add(TweenLite.to(sceneWrapper, .5, {backgroundColor: '#4DAEC2'}))
        .add(TweenLite.to(sceneWrapper, .4, {backgroundColor: '#deb887'}))
        .add(TweenLite.to(sceneWrapper, .1, {backgroundColor: '#20c997'}));

      const base = new ScrollMagic.Scene({triggerElement: '#story-mode', triggerHook: 0.8, duration: 2200})
        .setTween(bgTween)
        .addTo(controller);

      // Money tween
      const moneyTween = new TimelineLite({delay: .1})
        .add(TweenLite.to(moneyOne, 1, {attr: {transform: 'rotate(74 2000 -410)'}}));

      new ScrollMagic.Scene({triggerElement: '#story-mode', triggerHook: 0.05, duration: 400})
        .setTween(moneyTween)
        .addTo(controller);

      // Moja card
      const cardTween = new TimelineLite({delay: .7})
        // .add(TweenLite.from(mojaCard, 0, {attr: {transform: 'rotate(-12.04 -11137.38 6915.094)'}}))
        .add(TweenLite.to(mojaCard, 1, {attr: {transform: 'rotate(-12.04 -10498.357 3646.145)'}}));

      new ScrollMagic.Scene({triggerElement: '#story-mode', triggerHook: 0, duration: 600})
        .setTween(cardTween)
        .addTo(controller);

      // Money 2 tween
      const money2Tween = new TimelineLite({delay: 3})
        .add(TweenLite.to(moneyTwo, 1, {attr: {transform: 'rotate(89.03 2847.413 740.04)'}}));

      new ScrollMagic.Scene({triggerElement: '#story-mode', triggerHook: 0, duration: 400})
        .setTween(money2Tween);
      // .addTo(controller)

      base.on('enter', (ev) => {
        if (ev.scrollDirection === 'FORWARD') {
          document.querySelector('#story-mode .anim').classList.add('in');
        }
      }).on('leave', (ev) => {
        if (ev.scrollDirection === 'REVERSE') {
          document.querySelector('#story-mode .anim').classList.remove('in');
        }
      });
    },
    methods: {
      pathPrepare(elem) {
        var lineLength = elem.getTotalLength();
        elem.style['stroke-dasharray'] = lineLength;
        elem.style['stroke-dashoffset'] = lineLength;
      },
      checkIfMobile(mq) {
        this.isMobile = !mq.matches;
        return !mq.matches;
      }
    }
  };
</script>

